                            svg_elem.firstElementChild.style.height = "auto"
                            svg_elem.firstElementChild.style.padding = 0
                            svg_elem.firstElementChild.style.visibility = "hidden"
                            svg_elem.firstElementChild.style.position = "fixed"
                            svg_elem.firstElementChild.style.top = "-10000px"
                            
                            document.body.append(svg_elem.firstElementChild)
                            svg_elem = document.getElementById("svg_size_elem")
                            var svg_dimensions = svg_elem.getBoundingClientRect()
                            
                            if(svg_dimensions.height >= (canvas.height + 2)){
                                svg_elem.style.width = "auto"
                                svg_elem.style.height = canvas.height
                                svg_dimensions = svg_elem.getBoundingClientRect()
                            }

                            image_height = svg_dimensions.height
                            image_width = svg_dimensions.width
                            svg_elem.remove()
                        }
                        
                        x_offset = Math.round((canvas.width - image_width) / 2)
                        y_offset = Math.round((canvas.height - image_height) / 2)

                        ctx.drawImage(img, x_offset, y_offset)

                        canvas.toBlob(function(blob){

                            var form_data = new FormData()
                            form_data.append('png_name', image_info[0])
                            form_data.append('png_data', blob)

